  true,\n\t\"url\": null,\n\t\"notes\": \"3GPROF products provide global gridded monthly/daily
  precipitation averages from multiple satellites that can be used for climate studies.
  The 3GPROF products are based on retrievals from high-quality microwave sensors,
  which are sensitive to liquid and ice-phase precipitation hydrometeors in the atmosphere.The
  purpose of the 3GPROF algorithm is to provide monthly and daily mean precipitation
  and related retrieved parameters from the Level 2 GPROF precipitation profiling
  algorithm for the GPM core and constellation satellites. Each 3GPROF product contains
  global 0.25 degree x 0.25 degree gridded monthly/daily means. Because this product
  is an accumulation of the Level 2 retrieval products, much more information is available
  via the GPROF Level 2 documentation.\",\n\t\"license_title\": \"U.S. Government
